      SELECT DISTINCT + 65 + col1 * + col1 * 84 + + - col2 * col2 + + col2 + + col2 AS col0 FROM tab2 (FORMAT parquet) cor0 WHERE NOT - col0 + + - col0 <> NULL;
  - name: tab2

outputs:
  - name: q1648.out
    data: |
